import './App.css';

import Form from './components/Form/Form';
import Navbar from './components/Navbar/Navbar';
import TodoList from './components/TodoList/TodoList';

function App() {
  return (
    <div className="App">
        <Navbar/>
        <Form/>
        <TodoList/>
    </div>
  );
}

export default App;
